script:
frappe.ui.form.on('Company', {
	setup(frm) {
		frappe.call({
        method: "cheque_management.api.get_journal_naming_series",
        callback: function (r) {
        	if(r.message)
			{

				frm.set_df_property('journal_entry_naming_series', 'options',r.message);
                frm.refresh_field('journal_entry_naming_series');
			}
        }
    });
	}
})
